    false,nt"url": null,nt"notes": "NCEI Accession 0145902 includes physical,
    profile and underway data collected aboard the Sikuliaq during cruise SKQ201401S
    in the North Pacific Ocean from 2014-11-17 to 2014-12-13. These data include CONDUCTIVITY,
    CURRENT SPEED - EAST/WEST COMPONENT (U), CURRENT SPEED - NORTH/SOUTH COMPONENT (V),
    SALINITY and WATER TEMPERATURE. The instruments used to collect these data include
    ADCP, CTD and GPS. These data were collected by Brendan Roark of Texas A&M University,
    and by University of Alaska - Fairbanks as part of Recovery of Seamount Precious
    Coral Beds. The Lamont-Doherty Earth Observatory (LDEO) submitted these data to
    NCEI as part of the NSF sponsored Rolling Deck to Repository (R2R) program.nnThe
    ADCP data represent the raw and automated processed data set. Post processed quality
    assessed data are not available in this accession.",nt"license_title": null,nt"extras":
